import React, { Component } from "react";
import List from '../List';
import ActionInput from '../ActionInput';

export default class Todo extends Component {
    constructor(props) {
        super(props);
        this.state = {
            listItems: []
        };
    }

    render() {
        return (
            <div>
                <InputAction />
                <br/>
                <List
                    items={this.state.listItems}/>
            </div>
        );
    }
};
